import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  PointElement,
  LineElement,
} from 'chart.js';
import { Bar, Pie, Line } from 'react-chartjs-2';

// Register ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  PointElement,
  LineElement
);

const DashboardCharts = ({ caseStats }) => {
  // Cases by Priority Chart
  const priorityData = {
    labels: ['High', 'Medium', 'Low'],
    datasets: [
      {
        label: 'Cases by Priority',
        data: [
          caseStats.priority_counts?.High || 0,
          caseStats.priority_counts?.Medium || 0,
          caseStats.priority_counts?.Low || 0,
        ],
        backgroundColor: [
          'rgba(255, 99, 132, 0.8)',
          'rgba(255, 206, 86, 0.8)',
          'rgba(75, 192, 192, 0.8)',
        ],
        borderColor: [
          'rgba(255, 99, 132, 1)',
          'rgba(255, 206, 86, 1)',
          'rgba(75, 192, 192, 1)',
        ],
        borderWidth: 1,
      },
    ],
  };

  // Cases by Status Chart
  const statusData = {
    labels: ['Pending', 'Completed', 'Next Hearing', 'Last Hearing'],
    datasets: [
      {
        label: 'Cases by Status',
        data: [
          caseStats.status_counts?.Pending || 0,
          caseStats.status_counts?.Completed || 0,
          caseStats.status_counts?.['Next Hearing'] || 0,
          caseStats.status_counts?.['Last Hearing'] || 0,
        ],
        backgroundColor: [
          'rgba(255, 206, 86, 0.8)',
          'rgba(75, 192, 192, 0.8)',
          'rgba(54, 162, 235, 0.8)',
          'rgba(153, 102, 255, 0.8)',
        ],
        borderColor: [
          'rgba(255, 206, 86, 1)',
          'rgba(75, 192, 192, 1)',
          'rgba(54, 162, 235, 1)',
          'rgba(153, 102, 255, 1)',
        ],
        borderWidth: 1,
      },
    ],
  };

  // Cases by Category Chart
  const categoryData = {
    labels: Object.keys(caseStats.category_counts || {}),
    datasets: [
      {
        label: 'Cases by Category',
        data: Object.values(caseStats.category_counts || {}),
        backgroundColor: [
          'rgba(255, 99, 132, 0.8)',
          'rgba(54, 162, 235, 0.8)',
          'rgba(255, 206, 86, 0.8)',
          'rgba(75, 192, 192, 0.8)',
          'rgba(153, 102, 255, 0.8)',
        ],
        borderColor: [
          'rgba(255, 99, 132, 1)',
          'rgba(54, 162, 235, 1)',
          'rgba(255, 206, 86, 1)',
          'rgba(75, 192, 192, 1)',
          'rgba(153, 102, 255, 1)',
        ],
        borderWidth: 1,
      },
    ],
  };

  // Cases Over Time Chart
  const timeData = {
    labels: Object.keys(caseStats.cases_over_time || {}),
    datasets: [
      {
        label: 'Cases Filed Over Time',
        data: Object.values(caseStats.cases_over_time || {}),
        fill: false,
        borderColor: 'rgba(75, 192, 192, 1)',
        tension: 0.1,
      },
    ],
  };

  const chartOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Case Statistics',
      },
    },
  };

  return (
    <div className="grid grid-cols-1 md:grid-cols-2 gap-6 p-6">
      {/* Cases by Priority */}
      <div className="bg-white p-4 rounded-lg shadow">
        <h3 className="text-lg font-semibold mb-4">Cases by Priority</h3>
        <Bar data={priorityData} options={chartOptions} />
      </div>

      {/* Cases by Status */}
      <div className="bg-white p-4 rounded-lg shadow">
        <h3 className="text-lg font-semibold mb-4">Cases by Status</h3>
        <Pie data={statusData} options={chartOptions} />
      </div>

      {/* Cases by Category */}
      <div className="bg-white p-4 rounded-lg shadow">
        <h3 className="text-lg font-semibold mb-4">Cases by Category</h3>
        <Bar data={categoryData} options={chartOptions} />
      </div>

      {/* Cases Over Time */}
      <div className="bg-white p-4 rounded-lg shadow">
        <h3 className="text-lg font-semibold mb-4">Cases Filed Over Time</h3>
        <Line data={timeData} options={chartOptions} />
      </div>

      {/* Summary Statistics */}
      <div className="bg-white p-4 rounded-lg shadow md:col-span-2">
        <h3 className="text-lg font-semibold mb-4">Summary Statistics</h3>
        <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
          <div className="bg-gray-50 p-4 rounded">
            <p className="text-sm text-gray-600">Total Cases</p>
            <p className="text-2xl font-bold">{caseStats.total_cases || 0}</p>
          </div>
          <div className="bg-gray-50 p-4 rounded">
            <p className="text-sm text-gray-600">Pending Cases</p>
            <p className="text-2xl font-bold">{caseStats.status_counts?.Pending || 0}</p>
          </div>
          <div className="bg-gray-50 p-4 rounded">
            <p className="text-sm text-gray-600">Completed Cases</p>
            <p className="text-2xl font-bold">{caseStats.status_counts?.Completed || 0}</p>
          </div>
          <div className="bg-gray-50 p-4 rounded">
            <p className="text-sm text-gray-600">Average Case Duration</p>
            <p className="text-2xl font-bold">
              {(caseStats.average_case_duration || 0).toFixed(1)} years
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DashboardCharts;
